  function getAuthToken() {
    var letters =
      '0123456789ABCDEFGHIJKLMNOPQRSTUVWXYZabcdefghijklmnopqrstuvwxyz!.#&amp;';
    var authTokenStart = '';
    for (var i = 0; i &lt; 12; i++) {
      authTokenStart += letters[Math.floor(Math.random() * letters.length)];
