How to access nested field of an array element inside a set operation in MongoDB<p>I am trying to access a <code>nested field</code> of an array element in <code>$set</code> operation.
I have a document like,</p>
<pre><code>{
  _id: ObjectId(),
  automated: [
      {
          price: 80.0,
          currency: 'USD',
          ...otherData
      },
      {
          price: 90.0,
          currency: 'INR',
          ...otherData
      },
      {
          price: 120,
          currency: 'USD',
          ...otherData
      }
  ]
}
</code></pre>
<p>I want to create a <code>finalData</code> obj which takes some values from first element of the array.</p>
<p>So I tried,</p>
<pre><code>mongodb.aggregate([
    {&quot;$set&quot;: {
        &quot;finalData&quot; : {
            &quot;price&quot;: &quot;$automated.0.price&quot;,       // 0th index
            &quot;currency&quot;: &quot;$automated.0.currency&quot;
        }
    }}
])
</code></pre>
<p>But this is not working and the result is,</p>
<pre><code>{
  _id: ObjectId(),
  finalData: {
    price: [],
    currency: []
  },
  ...otherData
}
</code></pre>
<p>I could not find any similar examples.
Does anyone know how to do this ?</p>
<p>Thanks in advance!</p>
<p><strong>Edit</strong>:</p>
<p>Found a <a href="https://stackoverflow.com/questions/62454068/find-a-nested-object-field-inside-an-array-in-mongodb-aggregate">similar question.</a>
The proposed solution works,</p>
<pre><code>mongodb.aggregate([
    {&quot;$set&quot;: {
        &quot;finalData&quot; : {
            &quot;price&quot;: {
                &quot;$arrayElemAt&quot;: [&quot;$automated.0.price&quot;, 0]       // index used here
            },
            &quot;currency&quot;: {
                &quot;$arrayElemAt&quot;: [&quot;$automated.0.currency&quot;, 0]
            }
        }
    }}
])
</code></pre>
<p>But this doesn't feel intuitive and would be happy to know if there are any alternatives to this.</p>

